Commit Message:
Constant-fold unpack in prepare_files.

We had this structure widely spread out:
unpack = True
if link:
  if thing:
    raise
  else:
    stuff
else:
  unpack = False
if unpack:
  stuff2

First transform was:
if link:
  if thing:
    raise
  stuff
  unpack = True
else:
  unpack = False
if unpack:
  stuff2

Which made it obvious that we didn't need unpack:
if link:
  if thing:
    raise
  stuff
  stuff2

Fix assert message

- use python 2.6 compatible syntax
- add missing {}

Vendor pytoml==0.1.11

This looks like the best maintained TOML parser for Python at present;
it should be easy to switch if another one turns out to be preferable.

Move distributions/{source.py -> source/legacy.py}

This would simplify forsplitting up the build logic, in follow up
commits.
